import * as React from 'react';
import Header from 'features/common/components/Header'
import Footer from 'features/common/components/Footer'
import QnAComment from 'features/QnA/components/QnAComment';

import 'features/common/style/ViewLayout.css'

const ViewLayout = (props) => {
  return (
    <div class = "viewwrapper">
      <div class="viewcontainer">
        <span className="header"><Header/></span> 
          <span class ="viewmain">{props.children}</span>
          <span class ="QnAComment">{props.children}</span>
        <span class="Footer"><Footer/></span>
      </div>
    </div>
  );
}

export default ViewLayout;
